tables.table_schema:
CREATE TABLE protein_sequences (
   id SERIAL PRIMARY KEY,
   protein_id VARCHAR(50) UNIQUE,
   sequence TEXT
);

CREATE TABLE analysis_results (
   id SERIAL PRIMARY KEY,
   protein_id VARCHAR(50) REFERENCES protein_sequences(protein_id),
   analysis_type VARCHAR(50),
   result TEXT
);

CREATE TABLE proteins (
	protein_id INT PRIMARY KEY,
	sequence VARCHAR(255)
);

CREATE TABLE protein_annotations (
	annotation_id INT PRIMARY KEY,
	protein_id INT,
	description TEXT,
	FOREIGN KEY (protein_id) REFERENCES proteins(protein_id)
);

CREATE TABLE protein_structures (
	structure_id INT PRIMARY KEY,
	protein_id INT,
	structure_file VARCHAR(255),
	FOREIGN KEY (protein_id) REFERENCES proteins(protein_id)
);

CREATE TABLE ProteinSequence (
 id INT PRIMARY KEY,
 sequence TEXT
);

CREATE TABLE ProteinInfo (
 id INT PRIMARY KEY,
 name TEXT,
 description TEXT
);

CREATE TABLE ProteinStructure (
 id INT PRIMARY KEY,
 structure BLOB
);

CREATE TABLE ProteinAnalysis (
 id INT PRIMARY KEY,
 analysis_result TEXT
);

CREATE TABLE ProteinSequences (
    id SERIAL PRIMARY KEY,
    protein_name TEXT NOT NULL,
    sequence TEXT NOT NULL
);

CREATE TABLE ProteinAnnotations (
    id SERIAL PRIMARY KEY,
    protein_id INT REFERENCES ProteinSequences(id),
    annotation TEXT
);

CREATE TABLE ProteinDomains (
    id SERIAL PRIMARY KEY,
    protein_id INT REFERENCES ProteinSequences(id),
    domain_name TEXT
);

CREATE TABLE ProteinStructures (
    id SERIAL PRIMARY KEY,
    protein_id INT REFERENCES ProteinSequences(id),
    structure_data BYTEA
);

CREATE TABLE ProteinInteractions (
    id SERIAL PRIMARY KEY,
    protein_id INT REFERENCES ProteinSequences(id),
    interacting_protein_id INT REFERENCES ProteinSequences(id),
    interaction_type TEXT
);
